import { Eye, EyeOff } from "lucide-react";
import { useEffect, useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import logo from "../assets/logo.png";
import API from "../services/api";

const ResetPassword = () => {
  const navigate = useNavigate();
  const { state } = useLocation();

  const [password, setPassword] = useState("");
  const [confirm, setConfirm] = useState("");
  const [showPassword, setShowPassword] = useState(false);
  const [showConfirm, setShowConfirm] = useState(false);
  const [loading, setLoading] = useState(false);
  const [alert, setAlert] = useState({ type: "", message: "" });

  // Prevent direct access
  useEffect(() => {
    if (!state?.email || !state?.code) {
      navigate("/forgot-password");
    }
  }, [state, navigate]);

  // Auto-hide alerts
  useEffect(() => {
    if (alert.message) {
      const t = setTimeout(() => setAlert({ type: "", message: "" }), 3000);
      return () => clearTimeout(t);
    }
  }, [alert]);

  const submit = async () => {
    if (!password || !confirm) {
      setAlert({ type: "error", message: "All fields are required" });
      return;
    }

    if (password.length < 6) {
      setAlert({ type: "error", message: "Password must be at least 6 characters" });
      return;
    }

    if (password !== confirm) {
      setAlert({ type: "error", message: "Passwords do not match" });
      return;
    }

    setLoading(true);
    setAlert({ type: "", message: "" });

    try {
      await API.post("/auth/reset-password", {
        email: state.email,
        code: state.code,
        newPassword: password,
      });

      setAlert({ type: "success", message: "Password reset successfully!" });

      setTimeout(() => navigate("/login"), 1200);
    } catch (err) {
      setAlert({
        type: "error",
        message: err.response?.data?.message || "Password reset failed",
      });
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="app-background login-background">
      {/* Alert */}
      {alert.message && (
        <div
          className={`login-alert ${
            alert.type === "error" ? "login-alert-error" : "login-alert-success"
          }`}
        >
          {alert.message}
        </div>
      )}

      {loading ? (
        <div className="auth-page justify-content-center">
          <img src={logo} alt="Loading..." className="spinner-logo" />
        </div>
      ) : (
        <div className="auth-page">
          <div className="auth-glass-card">
            {/* Back button */}
            <button
              className="btn btn-link back-button"
              onClick={() => navigate(-1)}
            >
              &#8592;
            </button>

            <h3 className="text-center brand-gradient mb-4">
              Reset Password
            </h3>

            {/* New Password */}
            <div className="position-relative mb-3">
              <input
                type={showPassword ? "text" : "password"}
                className="form-control glass-input"
                placeholder="New Password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                autoComplete="new-password"
              />
              <span
                className="password-toggle"
                onClick={() => setShowPassword(!showPassword)}
              >
                {showPassword ? <EyeOff size={18} /> : <Eye size={18} />}
              </span>
            </div>

            {/* Confirm Password */}
            <div className="position-relative mb-4">
              <input
                type={showConfirm ? "text" : "password"}
                className="form-control glass-input"
                placeholder="Confirm Password"
                value={confirm}
                onChange={(e) => setConfirm(e.target.value)}
                autoComplete="new-password"
              />
              <span
                className="password-toggle"
                onClick={() => setShowConfirm(!showConfirm)}
              >
                {showConfirm ? <EyeOff size={18} /> : <Eye size={18} />}
              </span>
            </div>

            <button
              className="btn btn-green-custom w-100 py-2"
              onClick={submit}
            >
              Reset Password
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default ResetPassword;
